Consola Noastra
-------------------
Consola noastra cea de toate zilele, Sfinteasca-se numele tau! vie serverul tau, faca-se voia ta, precum la build height si la bedrock. Conexiunea noastra cea de toate zilele dane-o noua astazi si ne iarta de netul nostru prost;

